import React, { useState } from 'react'
import "./Cars.css"
import Car1 from "./img/image1.jpeg"
import Car2 from "./img/image1.jpeg"
import Car3 from "./img/image1.jpeg"

export const Cars = (CarInstance:string) => {
    const [cars] = useState([
        {
            strMark : "Ferrari A",
            strCategory : "Smth",
            strPrice : "2000",
            strTransmission : "Automatic",
            strStatus : "Available",
            strImagePath : {Car1}
        },
        {
            strMark : "Ferrari A",
            strCategory : "Smth",
            strPrice : "2000",
            strTransmission : "Automatic",
            strStatus : "Available",
            strImagePath : {Car2}
        },
        {
            strMark : "Ferrari A",
            strCategory : "Smth",
            strPrice : "2000",
            strTransmission : "Automatic",
            strStatus : "Available",
            strImagePath : {Car3}
        },
        {
            strMark : "Ferrari A",
            strCategory : "Smth",
            strPrice : "2000",
            strTransmission : "Automatic",
            strStatus : "Available",
            strImagePath : {Car1}
        },
        {
            strMark : "Ferrari A",
            strCategory : "Smth",
            strPrice : "2000",
            strTransmission : "Automatic",
            strStatus : "Available",
            strImagePath : {Car2}
        },
        {
            strMark : "Ferrari A",
            strCategory : "Smth",
            strPrice : "2000",
            strTransmission : "Automatic",
            strStatus : "Available",
            strImagePath : {Car3}
        },
        {
            strMark : "Ferrari A",
            strCategory : "Smth",
            strPrice : "2000",
            strTransmission : "Automatic",
            strStatus : "Available",
            strImagePath : {Car1}
        },
        {
            strMark : "Ferrari A",
            strCategory : "Smth",
            strPrice : "2000",
            strTransmission : "Automatic",
            strStatus : "Available",
            strImagePath : {Car2}
        },
        {
            strMark : "Ferrari A",
            strCategory : "Smth",
            strPrice : "2000",
            strTransmission : "Automatic",
            strStatus : "Available",
            strImagePath : {Car3}
        }
    ]);

    return (
      <div className="car-container my-4">
        <div className="row row-cols-3 gy-4 car-list" id="car-list">

          {cars.map((car, index) => (
              <CarInstance
                  key={index}
                  strMark={car.strMark}
                  strPrice={car.strPrice}
                  strImagePath={car.strImagePath}
              />
          ))}

        </div>
      </div>
    );
}
